Nanhi nanhi se Khushiyan!

Meeting the star Atif Aslam unexpectedly is one of the mithuest memories and nanhi nanhi se bari khushi 😁

When I met him, I didn't even realize how big a deal it was, because he was so humble and down to earth.

I attended Atif's first concert at Desom Lahore when I was in college and I remember how crazy we were all going to get his glimpse. Like a typical girl in her teenage. lol🤪
Wanted to take his autograph but couldn't even get closer due to the security.

A few years ago, I got to attend his concert again in California, USA and it was a magical experience. And couldn't even get to take a picture or his autograph this time too. But made a wish in my heart, Allah jee what if I'd get to meet him one day. Mithu baat he ho Jai age.😩

I was visiting Gilgit and on my first day of the trip, I went to Gilgit Serena and found out Atif Aslam was staying there for the video recording of 'Ik Naya Khuwab'.🤩☺️

Decided not to bother him, while he was in a meeting.We were having food and he came with his team to get food. When he was done placing the order, my friend went to him and introduced himself and us as well.
Oh my Gosh, I couldn't believe it. We literally chatted for 10 ish mins and he himself said Salam to my maa jee. Isn't that sweet? He literally spoke to our friend over the phone. 

Matlab k sweetness ke inteha ho Gaye. Who does that?

I was not happy with the pictures my friend took and he offered to take a selfie.
Must say end he mithu aadmi 🤗
No shokhi, no star tantrums, koi acting nahin.

Jee this was one of the biggest nanhi nanhi se khushi that I'd cherish always.

Been a fan since Aadat!
